import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEdit, faTrash } from '@fortawesome/free-solid-svg-icons';


export const BtnEditDel = ({ data, editarUsuario, excluirUsuario }) => (
  <div>
    <button type="button" className="btn btn-outline-primary btn-square" onClick={() => editarUsuario(data)}> <FontAwesomeIcon icon={faEdit} /></button>
    <button type="button" className="btn btn-outline-primary btn-square" onClick={() => excluirUsuario(data)}> <FontAwesomeIcon icon={faTrash} /></button>
  </div>
);
